profile_positions.description:
The educational program "ECO-Awareness of Dnipro 2020" is conducted by the public association "Assembly of Cultural Exchange of Ukraine" with the support of the Dnipro City Council, the Department of Environmental Policy of the Dnipro City Council, and the urban planning educational platform Terrain vague /France/.
The project is implemented within the framework of the "Program for the development of local self-government and coverage of the activities of the Dnipro City Council, its executive bodies and communal enterprises for 2017-2020".

The purpose of the project:
- To acquaint citizens with practitioners, startups, companies, organizations involved in the implementation of eco-politics in Ukraine.
- To provide citizens with the necessary knowledge and practical skills for the development of social awareness and independent transition to environmental policies and practices.
- Provide Dnipro organizations and initiative groups with support for already operating Ukrainian companies, as well as support for foreign specialists.
- Create a consolidated pool of changes.
Activities within the project:
- Conducting a program of conferences, panel discussions, round tables, trainings, courses, educational seminars, lectures, consultations, exhibitions, etc. aimed at the realization of goals and priority tasks;
- Issuance of printing products aimed at the implementation of program tasks;
- Organization and implementation of information campaigns in social networks on the topic of the eco-awareness program;
- Conducting cultural and educational activities on the subject of the project;
The new educational program on environmental awareness will cover the following topics:
- Local democracy and public participation;
- Sorting and disposal of waste;
- Zero waste policy;
- Recycling/upcycling;
- Environmental awareness;
- Conscious consumption.
